INSERT INTO `cms_block` VALUES ('2', 'Footer Links Company', 'footer_links_company', '\n<div class=\"links\">\n    <div class=\"block-title\">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href=\"{{store url=\"\"}}about-magento-demo-store/\">About Us</a></li>\n        <li><a href=\"{{store url=\"\"}}contacts/\">Contact Us</a></li>\n        <li><a href=\"{{store url=\"\"}}customer-service/\">Customer Service</a></li>\n        <li><a href=\"{{store url=\"\"}}privacy-policy-cookie-restriction-mode/\">Privacy Policy</a></li>\n    </ul>\n</div>', '2015-02-24 15:45:59', '2015-02-24 15:45:59', '1');
INSERT INTO `cms_block` VALUES ('3', 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2015-02-24 15:46:00', '2015-02-24 15:46:00', '1');
INSERT INTO `cms_block` VALUES ('246', 'Porto - Homepage Slider 2', 'porto_homeslider_2', '<div class=\"full-screen-slider\">\n    <div id=\"banner-slider-demo-2\" class=\"owl-carousel owl-theme owl-middle-narrow owl-banner-carousel\">\n        <div class=\"item\" style=\"background:#f0f0f0;background-image:linear-gradient(#e8e8e8,#f0f0f0);\">\n            <div style=\"width:100%;height:100%;background:url({{media url=\"wysiwyg/porto/homepage/slider/02/01.jpg\"}}) center center no-repeat; background-size:cover;\"></div>\n            <div class=\"content content-1\">\n                <img src=\"{{media url=\"wysiwyg/porto/homepage/slider/02/logo.png\"}}\" alt=\"\" />\n                <p style=\"color:#fff;font-weight:300;\">Premium Responsive Magento Theme</p>\n                <a class=\"btn btn-default\" href=\"#\" onclick=\"gohome();\">GET STARTED NOW</a>\n            </div>\n        </div>\n        <div class=\"item\" style=\"background:#f0f0f0;background-image:linear-gradient(#e8e8e8,#f0f0f0);\">\n            <div style=\"width:100%;height:100%;background:url({{media url=\"wysiwyg/porto/homepage/slider/02/02.jpg\"}}) center center no-repeat; background-size:cover;\"></div>\n            <div class=\"content content-2\">\n                <div style=\"display:inline-block;vertical-align:middle;\"><em class=\"type1\" style=\"font-weight:300;color:#fff;text-align:left;\">UP TO</em><h3 style=\"font-weight:700;color:#fff;\">70%</h3></div>\n                <div style=\"display:inline-block;vertical-align:middle;\">\n                    <em class=\"type2\" style=\"font-weight:300;color:#fff;text-align:left;\">Now starting at <b style=\"font-weight:600;\">$99</b></em>\n                    <div class=\"sale-bar\">\n                        <div class=\"triangle\">\n                            <div style=\"border-bottom-color: #08c;\"></div>\n                            <div style=\"border-top-color: #08c;\"></div>\n                        </div>\n                        <div class=\"f-left\" style=\"background-color:#08c;\"><h4 style=\"color:#fff;font-weight:600;margin:0;padding:0;border:0;\">OFF</h4></div>\n                        <div class=\"f-left\" style=\"background-color:#fff;\"><h4 style=\"color:#08c;font-weight:600;display:inline-block;\">HUGE <b style=\"font-weight:700;\">SALE</b></h4><a href=\"#\" style=\"font-weight:300;\" onclick=\"gohome();\">Shop now<i class=\"icon-angle-down\"></i></a></div>\n                        <div class=\"clearer\"></div>\n                    </div>\n                    <em class=\"type3\" style=\"font-weight:400;color:#fff;text-align:right;\"><b style=\"font-weight:600;\">Hurry up!</b> Sale ends 19th Nov.</em>\n                </div>\n            </div>\n        </div>\n        <div class=\"item\" style=\"background:#f0f0f0;background-image:linear-gradient(#e8e8e8,#f0f0f0);\">\n            <video poster=\"{{media url=\"wysiwyg/porto/homepage/slider/02/tablets.png\"}}\" autoplay loop><source src=\"{{media url=\"wysiwyg/porto/homepage/slider/02/tablets.mp4\"}}\" type=\"video/mp4\"><source src=\"{{media url=\"wysiwyg/porto/homepage/slider/02/tablets.webm\"}}\" type=\"video/webm\"></video>\n            <div style=\"background-color:#000;opacity:0.5;filter:alpha(opacity=50);position:absolute;z-index:1;left:0;top:0;width:100%;height:100%;\"></div>\n            <div class=\"content content-3\">\n                <h2 style=\"color:#fff;font-weight:600;\">VIDEO <b style=\"font-weight:800;\">BACKGROUNDS</b></h2>\n                <p style=\"color:#fff;font-weight:300;\">It\'s very simple to use!</p>\n                <a class=\"btn btn-default\" href=\"#\" onclick=\"gohome();\">SHOP NOW</a>\n            </div>\n        </div>\n    </div>\n    <script type=\"text/javascript\">\n        jQuery(function($){\n            $(\"#banner-slider-demo-2\").owlCarousel({autoPlay:true,stopOnHover: true,pagination: false, autoPlay: true,navigation: true,navigationText:[\"<i class=\'icon-chevron-left\'></i>\",\"<i class=\'