INSERT INTO `cms_block` VALUES ('342', 'Porto - Fashion Category Banner', 'porto_fashion_category_banner', '<div id=\"owl_women_category\" class=\"owl-carousel owl-theme category-boxed-banner\">\n          <div class=\"item\"><img src=\"{{media url=\"wysiwyg/porto/category/banner/02-01.png\"}}\" alt=\"\" /><div class=\"banner-text\" style=\"top:37%;\"><h2 style=\"background-color:transparent;color:#2b2b2b;margin:0;\">CATEGORY <b>BANNER</b></h2><br/><p style=\"max-width: 280px;background-color:transparent;color:#2b2b2b;font-weight:400;\">Set banners and description for any category of your website.</p></div></div>\n          <div class=\"item\"><img src=\"{{media url=\"wysiwyg/porto/category/banner/02-02.png\"}}\" alt=\"\" /><div class=\"banner-text\" style=\"top:45%;\"><img src=\"{{media url=\"wysiwyg/porto/category/banner/02-02-01.png\"}}\" alt=\"\" style=\"vertical-align:middle;width:auto;max-width:50%;\"/><a href=\"#\" class=\"shop-now\" style=\"color:#2b2b2b;vertical-align:middle;\">Shop now &gt;</a></div></div>\n</div>\n<script type=\"text/javascript\">\njQuery(function($) {\n \n  $(\"#owl_women_category\").owlCarousel({\n        lazyLoad: true,\n        slideSpeed : 300,\n        paginationSpeed : 400,\n        responsiveRefreshRate: 50,\n        slideSpeed: 200,\n        paginationSpeed: 500,\n        stopOnHover: true,\n        rewindNav: true,\n        rewindSpeed: 600,\n        singleItem : true\n  });\n \n});\n</script>', '2015-06-20 13:27:25', '2015-06-20 13:27:25', '1');
