INSERT INTO `cms_page` VALUES ('116', 'Porto - Homepage 14', 'one_column', null, null, 'porto_home_14', null, '<div class=\"homepage-bar\" style=\"border:1px solid #e1e1e1;margin:0 0 20px 0;\">\n    <div class=\"row\">\n        <div class=\"col-md-4\" style=\"text-align:center;height:60px;padding-top:5px;padding-bottom:5px;\">\n            <i class=\"icon-truck\"></i><div class=\"text-area\"><h3 style=\"font-size:14px;\">FREE SHIPPING & RETURN</h3><p>Free shipping on all orders over $99.</p></div>\n        </div>\n        <div class=\"col-md-4\" style=\"text-align:center;height:60px;padding-top:5px;padding-bottom:5px;\">\n            <i class=\"icon-dollar\"></i><div class=\"text-area\"><h3 style=\"font-size:14px;\">MONEY BACK GUARANTEE</h3><p>100% money back guarantee.</p></div>\n        </div>\n        <div class=\"col-md-4\" style=\"text-align:center;height:60px;padding-top:5px;padding-bottom:5px;\">\n            <i class=\"icon-lifebuoy\"></i><div class=\"text-area\"><h3 style=\"font-size:14px;\">ONLINE SUPPORT 24/7</h3><p>Lorem ipsum dolor sit amet.</p></div>\n        </div>\n    </div>\n</div>\n<div class=\"row\">\n    <div class=\"col-md-3 col-lg-2-4\">\n        <div class=\"home-side-menu-type2\" style=\"margin-bottom:20px;\">\n            <h2><i class=\"icon-menu\"></i> SHOP CATEGORIES</h2>\n            {{block type=\"core/template\" template=\"catalog/category/side_nav.phtml\"}}\n        </div>\n        <div class=\"featured-box-2\">\n            <h3><i class=\"icon-star\"></i> DEDICATED SERVICE</h3>\n            <p>Consult our specialists for help with an order, customization, or design advice.</p>\n            <a href=\"#\">Get in Touch &gt;</a>\n        </div>\n        <div class=\"featured-box-2\">\n            <h3><i class=\"icon-reply\"></i> FREE RETURNS</h3>\n            <p>We stand behind our goods and services and want you to be satisfied with them.</p>\n            <a href=\"#\">Returns Policy &gt;</a>\n        </div>\n    </div>\n    <div class=